import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import MediaLister from './MediaLister';
import ClientLister from './ClientLister';
import BorrowLister from './BorrowLister';
import AddMedia from './AddMedia';
import AddClient from './AddClient';
import AddBorrow from './AddBorrow';

const App = () => {
  return (
    <Router>
      <div>
        <nav className="navbar">
          <h1>Videoteka</h1>
          <ul>
            <li><a href="/">Media</a></li>
            <li><a href="/clients">Clients</a></li>
            <li><a href="/borrows">Borrows</a></li>
            <li><a href="/add-media">Add Media</a></li>
            <li><a href="/add-client">Add Client</a></li>
            <li><a href="/add-borrow">Add Borrow</a></li>
          </ul>
        </nav>

        <Switch>
          <Route path="/" exact component={MediaLister} />
          <Route path="/clients" component={ClientLister} />
          <Route path="/borrows" component={BorrowLister} />
          <Route path="/add-media" component={AddMedia} />
          <Route path="/add-client" component={AddClient} />
          <Route path="/add-borrow" component={AddBorrow} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
